import { useQuery } from "@tanstack/react-query"
import USER_API from "../api/User"

export const useUserList = () => {
  return useQuery({
    queryKey: ["userList"],
    queryFn: async() =>{
      return USER_API.users();
    }
  })
};

export const useUser = (id) => {
  return useQuery({
    queryKey: ["user"],
    queryFn: async()=>{
      console.log(id)
      return USER_API.user(id);
    }
  })
}
